import React, {Component} from 'react';
import Layout from './../components/layout/layout';

class Index extends Component{
    render(){
       return (
           <div>
                <Layout>
                <div class="AppContent wrapper wrapper-signup" id="page-container">
                    <link rel="stylesheet" href="https://abs.twimg.com/a/1511833274/css/t1/t1_signup.bundle.css"></link>
                    <div class="page-canvas">
                        <div class="signup-wrapper">
						<h1>Join Twitter Clone today.</h1>
                        </div>
                        <div class="t1-form signup " id="phx-signup-form">
                        </div>
                    </div>    
                </div>
                </Layout>
            </div>
        );
    }
}

export default Index;
